width="1" height="8">',TLe="<label for={8} style='{2};{7}' class=x-form-item-label>{1}{4}<\/label>",Bbf='<label style="color: black;">',zbf='<label style="color: black;font-style:italic;background-color:',$sf='<lasad-list>',aHe="<li class='{style}' id={id} role='tab' tabindex='0'><a class=x-tab-strip-close role='presentation'><\/a>",ZGe="<li class=x-tab-edge role='presentation'><\/li>",vff='<ontology type="',sdf='<p align="center"><b><font color="black" size="4">  ',Qgf='<p><b>Description:<\/b> In this first step, you can define user accounts. These are needed to login to the system. On the left-hand side, there is an overview of existing user accounts sorted by role. On the right-hand side, you have the possibility to add or delete user accounts.<br><br><\/p><p><b>Add user:<\/b> Each user is defined by a unique username, a password (consisting of at least 8 characters), and a role. Connected to each user role, there is a set of rights. A "Guest" is only able to participate in an existing map. In addition to a "Guest" users that have the role "Standard" assigned are able to create new maps from templates. In addition to that the "Teacher" is also able to access this authoring tool, whereas the "Developer" will see logs that are useful to detect errors in the code basis of LASAD and has access to untested system features.<br><br><\/p><p><b>Delete user:<\/b> If you want to delete a user account, just choose it from the list. If this user is author of a template or contributed to a map, his or her username will be replaced by "Unknown".<\/p>',phf='<p><b>Description:<\/b> In this second step, you can create and delete ontologies. An ontology is a definition of elements that are available for argument modeling, i.e. boxes and relations in the usual graph-based visualization of LASAD. user accounts. On the left-hand side, there is an overview of existing ontologies. To modify the element definitions of these ontologies, you can click on one of them, which will enable step 2b.<br><br><\/p><p><b>Add ontology:<\/b> Here, you need to provide a unique name for the new ontology. The new ontology will not contain any elements. To add elements create an ontology, choose it from the overview on the left-hand side and open <i>Step 2b: Edit ontology<\/i>.<br><br><\/p><p><b>Delete ontology:<\/b> If you want to delete an existing ontology, just choose it from the list. However, if you delete an ontology which is used by one or multiple templates, these templates and all maps that are based on these templates will be deleted as well. Use this option with care!<\/p>',thf='<p><b>Description:<\/b> In this step, you will be able to edit the elements of the chosen ontology. There is an overview of nodes and relations of the ontology on the left-hand side ("Elements of this ontology"), whereas a preview of the currently selected element is shown on the right-hand side. The actions that can be done are shown in the bottom area in this step. Please consult the manual for further instructions.<br><br><\/p>',Iff='<p><b>Description:<\/b> Once the ontology and template is defined, you have here the possibility to create concrete instances of an argument map. On the left-hand side, there is an overview of all existing maps (pre-defined as well as user-created ones) sorted by template. On the right-hand side, you can choose if you want to add or delete a map.<br><br><\/p><p><b>Add map:<\/b> To add a new map, you have to choose a template on which the map is based on. Further, each map requires a unique name, which will appear in the map overview after login. Optionally, you can restrict a map to a single user (this of course does only makes sense, if you do not plan to argue collaboratively in this map). To restrict a map to a specific user, choose one from the list. Otherwise leave the field emptry to make it accessible for all users of the system. If you do not want to create pre-defined maps, you can skip this step. Users with role "Standard" (or higher) have the possibility to create new maps based on templates in the map overview anyway.<br><br><\/p><p><b>Delete map:<\/b> If you want to delete a map, just choose it from the list. However, you will no longer be able to replay or restore the contents of the map.<\/p>',Bgf='<p><b>Description:<\/b> Once, the ontology is defined, there is a need for a template. Whereas the ontology defines the elements available for modeling the argument, the template is used to configure the interface of the system. On the left-hand side of this step, there is an overview of existing templates sorted by ontologies. Similar to the other steps, there is - on the right-hand side - a set of possible actions: (1) add template, and (2) delete template.<br><br><\/p><p><b>Add template:<\/b> As a first step, you have to decide if you want to support individual or collaborative argumentation. If you want to support argumentation in groups, you have to enable the checkbox "Collaboration". Once, you enable collaboration, you have a set of options that needs to be defined:<br><br><\/p><ul><li><i>Maximum number of users<\/i><br><\/li><li><i>List of active users:<\/i> Shows a list of users that are actively working on a map instance based on the template<br><\/li><li><i>Use chat:<\/i> Provide a simple text chat in the interface<br><\/li><li><i>Cursor tracking(not recommended for standard use):<\/i> The users\' cursors will be visible to all other users that participate at an argument map (next step) which is based on this template. <i>Important:<\/i> This option should be used with care! It will cause a lot of traffic which may lead to problems with slow connections or multiple / larger groups of users.<br><br><\/li><\/ul><p>The next step to decide is if there should be a given internally text that can be used to create relations between the text and the argument elements. To enable linking between the text and the argument element, it is important to know that it is only possible to relate an element to a complete line (or multiple lines) but not to single words or parts of a transcript line.<\/p><p>In addition to these specific options, there is a set of general options. Here, you have to choose on which ontology the template is based as well as a unique and a (optional) description which appears during login in the details of the map.<br><br><\/p><p><b>Delete template:<\/b> If you want to delete an existing template, just choose it from the list. If this template is used by one or more map, these maps will be deleted as well and not restoreable!<\/p>',Xsf='<pre>',NNe='<span  unselectable=on class="x-tree3-node-text">',qNe='<span class="x-tree3-node-check"><\/span>',sNe='<span class="x-tree3-node-icon"><\/span>',cHe="<span class='x-tab-strip-inner' role='presentation'><span class='x-tab-strip-text {textStyle} {iconStyle}'>{text}<\/span><\/span>",mjf='<span style="color: #000000;">Blue<\/span>',zjf='<span style="color: #000000;">Dashed<\/span>',xjf='<span style="color: #000000;">Double<\/span>',Vhf='<span style="color: #000000;">Editable<\/span>',Bif='<span style="color: #000000;">First<\/span>',ljf='<span style="color: #000000;">Green<\/span>',tif='<span style="color: #000000;">Label',Whf='<span style="color: #000000;">Non-Editable<\/span>',vif='<span style="color: #000000;">Option1<\/span>',xif='<span style="color: #000000;">Option2<\/span>',zif='<span style="color: #000000;">Option3<\/span>',jjf='<span style="color: #000000;">Orange<\/span>',sjf='<span style="color: #000000;">Other... <\/span>(<span style="color: ',njf='<span style="color: #000000;">Other...<\/span>',ijf='<span style="color: #000000;">Red<\/span>',yjf='<span style="color: #000000;">Round Edges<\/span>',Cif='<span style="color: #000000;">Second<\/span>',vjf='<span style="color: #000000;">Standard<\/span>',Dif='<span style="color: #000000;">Third<\/span>',kjf='<span style="color: #000000;">Yellow<\/span>',wjf='<span style="color: #000000;">Zig Zag<\/span>',B8e='<span style="color:#333;">',tNe=
